import React from 'react';
import './CoffeeBrewing.css'; // Import the CSS file containing the animation styles

const CoffeeBrewingAnimation = () => {
  return (
    <div className="coffee-brewing-container">
      <div className="coffee-pot">
        <div className="coffee">
          <div className="handle"></div>
        </div>
      </div>
      <div className="coffee-steam"></div>
    </div>
  );
}

export default CoffeeBrewingAnimation;
